import { alphabet } from "./key-alphabet";
export function milliseconds(key) {
    let result = 0;
    for (let i = 0; i < 8; ++i) {
        const index = alphabet.indexOf(key.charAt(i));
        if (index === -1) {
            throw new Error(`Unexpected character '${key.charAt(i)}'.`);
        }
        result = (result * 64) + index;
    }
    return result;
}
